import React, { Component } from 'react'
import Info from './Info'
import Header from './Header'
import Hoss from './Hoss'
import Home from './Home'
import Face from './Face'
import { Switch, Route, Redirect } from 'react-router-dom';
import { MDBBtn, MDBCollapse, MDBCard,MDBCardTitle, MDBCardText,MDBCardBody} from 'mdbreact';

export class Main extends Component {
  constructor(props)  {
      super(props);
      this.state = {

          collapseID: ""

            };
            }
  toggleCollapse = collapseID => () => {
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ""
    }));
  }

render() {
     const Form = () =>{ 
      return(
     <div className=" col-12 col-md-10 ">


    <MDBBtn
      color="primary"
      onClick={this.toggleCollapse("basicCollapse")}
      style={{ marginBottom: "1rem" }}>
      COLLAPSE BUTTON
    </MDBBtn>
    <MDBCollapse id="basicCollapse" isOpen={this.state.collapseID}>

     <MDBCard style={{ width: "22rem" }} 
     id= 'form' isOpen={this.state.isButtonOpen} toggle={this.toggleButton} className="collapse multi-collapse">

     <MDBCardBody>
    <MDBCardTitle  className='row justify-content-center'>Hoss</MDBCardTitle>
    <MDBCardText style={{ fontSize: "2rem" }} className='row justify-content-center' >
    I am a web developer
    </MDBCardText>
    </MDBCardBody>
    </MDBCard>
    </MDBCollapse>

    </div>)

    }

  return (
    <div >
      <Form />
      <Header />
      <Switch>
      <Route  path="/info" component={Info} />
      <Route path="/home" component={Home} />
      <Route path= "/face" component={Face} />
      <Redirect to="/hoss" component={Hoss} />

      </Switch>
      <Hoss />
    </div>
  )
}
}

export default Main
